commit_message:
Adds python version of C# execution models - Typoes were fixed in `ImmediateExecutionModel.cs`;
- Refactors `PriceIsFavorable` methods in `StandardDeviationExecutionModel` and `VolumeWeightedAveragePriceExecutionModel` C# models;
- Adds python version of C# execution models

Reorganised Lean Desktop to be launched from the Launcher. Moved UI Layout to mainly use VS Winforms Designer Reorganised Lean Desktop to be launched from the Launcher.
Moved UI Layout to mainly use VS Winforms Designer.
//TODO reorganise Result Handler properly.

Adds ReaderWriterLockSlimExtensions to reduce verbosity Usage:
	var slim = new ReaderWriterLockSlim();
	using (slim.Read())
	{
		// perform read
	}
	using (slim.Write())
	{
		// perform write
	}

Allow two forms of reflection methods OnData(TypeName data);
On{TypeName}(TypeName data);

For example,

OnData(Quandl data); // existing
OnQuandl(Quandl data); // new

Adds fluent interface for scheduled events Algorithms can now use syntax like the following to define events:
Schedule.Event(name).{DateRuleMethod}.{TimeRuleMethod}.Run( lambda )

For example: Schedule.Event(tues).Every(DayOfWeek.Tuesday).AfterMarketOpen(SPY, 20).Run(MyTuesdayHandler);

Adds indicator math extensions for constant values decimal two = 2m;
indicator.Plus(two);
indicator.Minus(two);
indicator.Over(two);
indicator.Times(two);
